$(".removeWish").click(function(){createModal({id:"removeWishModal",modal:"removeWish",title:"Confirmation"},()=>{let e=$(this).attr("data-id")||$(this).parent().attr("data-id");$("#btnRemoveWish").attr("onclick",`removeWish(${e})`)})});let removeWish=e=>{let i=$("#csrfToken").val();$.delete(`/api/candidate/wish/${e}`,{_csrf:i},i=>{i.deleted&&(notification({icon:"check-circle",type:"success",title:"Candidature supprimée avec succès.",message:""}),$(`tr[data-applicationid="${e}"]`).remove())}).catch(e=>{if(void 0===(e=e.responseJSON)||"Not exists"!==e.error)return errorsHandler(e);notification({icon:"exclamation",type:"danger",title:"Suppression impossible",message:"Erreur lors de la suppression de la candidature."})})};